/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_prevent_negative_stock` BEFORE INSERT ON `purchase_item` FOR EACH ROW BEGIN
    DECLARE available_stock INT;
    SELECT stock INTO available_stock FROM products WHERE sku = NEW.sku;
    IF available_stock < NEW.quantity THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'ç•§Æ·‚†‚ÆÁ≠Æ ‚Æ¢†‡† ≠† ·™´†§•';
    END IF;
END */;;
